script: |
  super -f text -I q6954.spq | sort > q6954.out

inputs:
  - name: q6954.spq
    data: |
      SELECT 39 + + ( - SUM ( - col0 ) ) * 60 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT 42 * + 80 * + - col0 BETWEEN ( - + col2 + + ( + col0 ) * - 30 ) AND - 92;
  - name: tab2

outputs:
  - name: q6954.out
    data: |
      11139
